import './Contacts.css';

function Contacts(){
    return(
        <div className='contacts'>
            <div className='contacts-wrapper'>
                <section>
                    <div className='contacts-header'>
                        <hr></hr>
                        <h1>Contact</h1>
                        <hr></hr>
                    </div>
                </section>
            </div>
        </div>
    );
}

export default Contacts
